    inactivo INT
);

CREATE TABLE Facultades (
    facultad INT PRIMARY KEY,
    nombre VARCHAR2(100),
    fecha_creacion DATE,
    inactivo INT,
    user INT
);

CREATE TABLE Responsable_Facultad (
    facultad INT NOT NULL,
