    titulo VARCHAR2(80),
    grado VARCHAR2(80),
    telefono VARCHAR2(15),
    movil VARCHAR2(15),
    email VARCHAR2(50),
    fecha_creacion DATE NOT NULL,
    tipo_persona INT NOT NULL,
    inactivo VARCHAR2(45) NOT NULL,
    titulo_corto VARCHAR2(55),
    titulo_abreviado VARCHAR2(45),
    sexo VARCHAR2(1),
    estado_civil INT,
    delete INT NOT NULL
);


CREATE TABLE Usuarios (
    usuario INT PRIMARY KEY,
    persona INT NOT NULL,
    name VARCHAR(45) NOT NULL,
    pass VARCHAR(45) NOT NULL,
    user INT,
    fecha_creacion DATE NOT NULL,
    inactivo INT NOT NULL,
    cambio_pass INT,
