    FOREIGN KEY (persona) REFERENCES Personas(persona)
);

CREATE TABLE Casos (
    idcaso INT PRIMARY KEY,
    facultad INT NOT NULL,
    correo VARCHAR2(45),
    asunto VARCHAR2(45) NOT NULL,
    descripcion VARCHAR2(200) NOT NULL,
    estatus INT NOT NULL,
    notas VARCHAR2(600),
    fecha_crea DATE NOT NULL,
    usuario_crea INT NOT NULL,
    fecha_mod DATE,
    usuario_mod INT,
    fecha_sol DATE,
    usuario_sol INT,
    inactivo INT NOT NULL,
    responsable INT,
    FOREIGN KEY (facultad) REFERENCES Facultades(facultad),
    FOREIGN KEY (estatus) REFERENCES Estados(idestado),
    FOREIGN KEY (usuario_crea) REFERENCES Usuarios(usuario),
    FOREIGN KEY (usuario_mod) REFERENCES Usuarios(usuario),
    FOREIGN KEY (usuario_sol) REFERENCES Usuarios(usuario),
    FOREIGN KEY (responsable) REFERENCES Responsable_Facultad(responsable)
);


CREATE TABLE Movimientos (
